import "./styles.css";

import React, { Component } from "react";
import Logic from "./logic";

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      c: 0,
      ipVars: {},
    };
  }
  render() {
    return (
      <div className="App">
        <Logic />
      </div>
    );
  }
}

export default App;
